import logo from '../logo.svg';
import Menus from '../Components/Menus';
import Menu2 from '../Components/Menu2';
import Footer from '../Components/Footer';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import AddIcon from '@mui/icons-material/Add';
import ListGroup from 'react-bootstrap/ListGroup';
import './Style.css';
import axios from "axios";
import React, { useState, useEffect,useRef } from "react";

function AllChallenges() {

    const [toggleState, setToggleState] = useState(1);

    const toggleTab = (index) => {
      setToggleState(index);
    };
  
  const [eventsUpcom, setEvents] = useState([]);


  useEffect(() => {
    function getEvents() {
      axios
        .get("http://localhost:8070/Events/getEventsAll")
        .then((res) => {
          setEvents(res.data);
        })
        .catch((err) => {
          alert(err.message);
        });
    }
    getEvents();
  }, []);

    function changeDate(date){
      var  mydate = new Date(date);
      var month = ["January", "February", "March", "April", "May", "June",
      "July", "August", "September", "October", "November", "December"][mydate.getMonth()];
      var cont ;
      switch(mydate.getDate()%10){
        case 1: 
          cont ="st";
          break;
        case 2:
          cont ="nd";
          break;
        case 1:
          cont ="rd";
          break;
        default:
          cont ="th";
      }
      var str = mydate.getDate()+ cont +' ' + month + ' ' + mydate.getFullYear();
      return str;
    }

  return (
    <div className="App">
      <Menus />
      <Menu2 />
      <div className="HeaderEvent" id="all">
        <div className="content-title" id="headerEvent">
          Challenges
        </div>
        <div className="HeaderEvent-sub-title">
          Browse to particpate and know more about the organic food <br />
          industry.
        </div>
        <div className="HeaderEvent-btn">
          <Button variant="primary" id="browse" href="/Add">
            <AddIcon id="add" />
            <div className="btn-title">Add Challenges</div>
          </Button>{" "}
        </div>
      </div>

      <div className="bloc-tabs">
        <button
          className={toggleState === 1 ? "tabs active-tabs" : "tabs"}
          onClick={() => toggleTab(1)}
        >
          Tab 1
        </button>
        <button
          className={toggleState === 2 ? "tabs active-tabs" : "tabs"}
          onClick={() => toggleTab(2)}
        >
          Tab 2
        </button>
        <button
          className={toggleState === 3 ? "tabs active-tabs" : "tabs"}
          onClick={() => toggleTab(3)}
        >
          Tab 3
        </button>
      </div>

      <div className="content-tabs">
        <div
          className={toggleState === 1 ? "content  active-content" : "content"}
        >
          <h2>Content 1</h2>
          <hr />
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Obcaecati
            praesentium incidunt quia aspernatur quasi quidem facilis quo nihil
            vel voluptatum?
          </p>
        </div>

        <div
          className={toggleState === 2 ? "content  active-content" : "content"}
        >
          <h2>Content 2</h2>
          <hr />
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Sapiente
            voluptatum qui adipisci.
          </p>
        </div>

        <div
          className={toggleState === 3 ? "content  active-content" : "content"}
        >
          <h2>Content 3</h2>
          <hr />
          <p>
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Eos sed
            nostrum rerum laudantium totam unde adipisci incidunt modi alias!
            Accusamus in quia odit aspernatur provident et ad vel distinctio
            recusandae totam quidem repudiandae omnis veritatis nostrum
            laboriosam architecto optio rem, dignissimos voluptatum beatae
            aperiam voluptatem atque. Beatae rerum dolores sunt.
          </p>
        </div>
      </div>

      <div className="Events">
        <div className="Cards" id="all">
          {eventsUpcom.map((item) => (
            <Card id="event-card">
              <Card.Img variant="top" src={item.EventPhoto} />
              <Card.Body>
                <Card.Title id="eventInfo-date">
                  On {changeDate(item.DateEvent)}
                </Card.Title>
                <Card.Title id="eventInfo-title-all">
                  {item.EventType}
                </Card.Title>
              </Card.Body>
              <ListGroup className="list-group-flush" id="author">
                <ListGroup.Item>
                  <img id="profile-pic" src={item.UserID.userPhoto} />
                </ListGroup.Item>
                <ListGroup.Item id="auth-name">
                  {item.UserID.userName}
                </ListGroup.Item>
              </ListGroup>
              <Button variant="primary" id="more" href={`/Create/${item._id}`}>
                <div className="btn-title" id="more">
                  Read more
                </div>
              </Button>{" "}
            </Card>
          ))}
        </div>
      </div>

      <Footer />
    </div>
  );
}

export default AllChallenges;
